import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import SignupPage from './components/signup';
import LoginPage from './components/login';
import HomePage from './components/home';
import Dashboard from './components/dashboard';
import ProfilePage from './components/Profile';
import MapPage from './components/MapPage';
import Encyclopedia from './components/Encyclopedia';
import AddAnimal from './components/AddAnimal';
import './App.css';

const App = () => {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [isAdmin, setIsAdmin] = useState(false);

    useEffect(() => {
        const username = localStorage.getItem('username');
        const userType = localStorage.getItem('userType');

        if (username) {
            setIsAuthenticated(true);
            setIsAdmin(userType === 'admin'); // Check if the user is admin
        }
    }, []);

    const handleLogout = () => {
        // Clear user session and update the state
        localStorage.removeItem('username');
        localStorage.removeItem('userType');
        setIsAuthenticated(false);
        setIsAdmin(false);
    };

    return (
        <Router>
            <div className="navbar">
                <div className="logo">Wild Track</div>
                <ul>
                    {isAdmin ? (
                        <>
                            <li><Link to="/dashboard">Dashboard</Link></li>
                            <li><Link to="/add-animal">Add Animal</Link></li>
                            <Link to="/login">Login</Link>
                        </>
                    ) : (
                        <>
                            <li><Link to="/home">Home</Link></li>
                            <li><Link to="/map">Map</Link></li>
                            <li><Link to="/encyclopedia">Encyclopedia</Link></li>
                            <li><Link to="/profile">Profile</Link></li>
                        </>
                    )}
                </ul>
                <div className="auth-links">
                    {!isAuthenticated ? (
                        <>
                            <Link to="/login">Login</Link>
                            <Link to="/signup">Sign Up</Link>
                        </>
                    ) : (
                        <button onClick={handleLogout}>Logout</button>
                    )}
                </div>
            </div>
            <Routes>
                <Route path="/" element={<Navigate to="/login" replace />} />
                <Route path="/signup" element={<SignupPage />} />
                <Route path="/login" element={<LoginPage />} />
                {isAdmin && <Route path="/dashboard" element={<Dashboard />} />}
                {isAdmin && <Route path="/add-animal" element={<AddAnimal />} />}
                {!isAdmin && (
                    <>
                        <Route path="/home" element={<HomePage />} />
                        <Route path="/map" element={<MapPage />} />
                        <Route path="/encyclopedia" element={<Encyclopedia />} />
                        <Route path="/profile" element={<ProfilePage />} />
                    </>
                )}
                <Route path="*" element={<NotFound />} />
                {!isAuthenticated && <Route path="*" element={<Navigate to="/login" replace />} />}
            </Routes>
        </Router>
    );
};

// Simple Not Found component
const NotFound = () => {
    return (
        <div>
            <h2>404 - Not Found</h2>
            <p>The page you are looking for does not exist.</p>
        </div>
    );
};

export default App;
